import Vue from 'vue';
import VueRouter from 'vue-router';
import App from './App.vue';
import YourComponent from './YourComponent.vue'; // Import your component here

Vue.use(VueRouter);

const routes = [
  { path: '/home', component: YourComponent },
  // Define other routes as needed
];

const router = new VueRouter({
  routes,
});

new Vue({
  render: h => h(App),
  router, // Make sure to pass the router instance to the Vue instance
}).$mount('#app');
